import React from 'react';

const Calculator = () => {
    const operators = ['-', '+', 'x', 'รท', '='];
    const numbers = [];

    for (let i = 0; i < 9; i++) {
        numbers.push(i);
    }

    return (
        <div className='calculator'>
            <div className='display'/>
            <div className='keypad'>
                {numbers.map(number => (
                    <button key={number} className='key'>
                        {number}
                    </button>
                ))}
                {operators.map(operator => (
                    <button key={operator} className='key'>
                        {operator}
                    </button>
                ))}
            </div>
        </div>
    );
}

export default Calculator;
